Abel Grey krijgt de opdracht de dood van een jongen te onderzoeken, wiens lijk in de rivier nabij zijn exclusieve school, gevonden werd. Abel ontdekt dat de jongen erg veel gepest 
werd op school en vermoed dat een grap uit de hand is gelopen. Niet alleen krijgt hij tegenwerking van zijn politie-departement omdat de school een genereuze donateur is, maar 
ook krijgt hij het idee dat de geest van de jongen aanwijzingen voor hem achterlaat.:
